import React from 'react';
import { Link } from "react-router-dom";

const Navbar = () => {
    return (
        <nav>
            <div>
                <p>HelpBook</p>
            </div>
            <div>
                <Link to="/">Main</Link>
                <Link to="/ReactPage">React</Link>
                <Link to="/MernPage">Mern</Link>
            </div>
        </nav>
    )
}

export default Navbar
